import React from "react";

export const DailyForecast = (props) => {
    const nums = [0, 1, 2, 3, 4, 5, 6, 7]
    const forecastList = nums.map((num) => {

        return props.forecast[num].dt (
            <div className="days_forecast">
                <div className={props.isToggle ? 'day_weather dark_mode_right_card' : 'day_weather'}>
                    <h5 className="day">{forecastList}</h5>
                </div>
            </div>
        )
        
    })
}
